/* Procedure structure for procedure `SP_MODIFICAR_CATEGORIA` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_MODIFICAR_CATEGORIA` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_MODIFICAR_CATEGORIA`(IN `IDCATEGORIA` INT, IN IDSECCION INt, `CATEGORIA_ACTUAL` VARCHAR(250), IN `CATEGORIA_NUEVO` VARCHAR(250),
 IN `DESCRIPCION` VARCHAR(100))
BEGIN
DECLARE CANTIDAD INT;
IF CATEGORIA_ACTUAL = CATEGORIA_NUEVO THEN
	UPDATE categorias SET
	`idSeccion` =IDSECCION,
	`descripcion`=DESCRIPCION
	WHERE id = IDCATEGORIA;
SELECT 1;
ELSE 

SET @CANTIDAD:=(SELECT COUNT(*) FROM categorias WHERE nombre=CATEGORIA_NUEVO);
IF  @CANTIDAD = 0 THEN
UPDATE categorias SET
	nombre=CATEGORIA_NUEVO,
	`idSeccion` =IDSECCION,
	`descripcion`=DESCRIPCION
	WHERE id = IDCATEGORIA;
SELECT 1;
ELSE 
SELECT 2;
END IF;
END IF;
END */$$
DELIMITER ;

